import React from "react";
import './App.css';
import Sidebar from "./Sidebar";

function App() {
  return (
  // BEM Naming Convention
  <div className="app">

    {/* Main Panel */}
    <div className="app__body">
      {/* Sidebar */}
      <Sidebar />
      {/* Chat */ }
      <Chat />

    </div>
  </div>
  );
}

export default App;
